export const LOG_IN = "LOG_IN"
export const REGISTER = "REGISTER"
export const LOG_OUT = "LOG_OUT"
export const POST = "POST"
export const SEARCH = "SEARCH"
export const ADD_NEW_FOLLOWING = "ADD_NEW_FOLLOWING"
export const UNFOLLOW = "UNFOLLOW"
export const UPDATE_INFO = "UPDATE_INFO"
export const UPDATE_PASSWORD = "UPDATE_PASSWORD"
export const CHANGE_TAB = "CHANGE_TAB"
export const UPDATE_STATUS = "UPDATE_STATUS"

export function logIn(values) {
    return {type: LOG_IN, values}
}

export function register(values) {
    return {type: REGISTER, values}
}

export function logOut(values) {
    return {type: LOG_OUT, values}
}

export function changeTab(values) {
    return {type: CHANGE_TAB, values}
}

export function post(values) {
    return {type: POST, values}
}

export function search(values) {
    return {type: SEARCH, values}
}

export function addNewFollowing(values) {
    return {type: ADD_NEW_FOLLOWING, values}
}

export function unfollow(values) {
    return {type: UNFOLLOW, values}
}

export function updateInfo(values) {
    return {type: UPDATE_INFO, values}
}

export function updatePassword(values) {
    return {type: UPDATE_PASSWORD, values}
}

export function updateStatus(values) {
    return {type: UPDATE_STATUS, values}
}
